The 1978 National Rugby Championships were a series of tournaments organized to determine a national champion in several divisions for United States rugby teams. The divisions included College, Women's club and Interterritorial. 
College.
The 1978 College championship took place from February 4-5 at LSU's Parade Grounds in Baton Rouge, Louisiana. Palmer College of Chiropractic were the champions. Palmer had previously won championships in 1972 and 1973 and were runners-up in 1975 and 1976. Palmer won three matches in the series to win the title.&lt;br&gt;
Championship Bracket
Consolation Bracket
ITT.
The Inter Territorial Tournament involved the four regional rugby unions comprising the United Stated RFU: Pacific Coast RFU, Western RFU, Midwest RFU, and the Eastern Rugby Union. The region teams are formed from selected players from the sub regional rugby unions. Subsequently the USA Eagles are selected from the four regional teams after the ITT concludes. The 1978 edition was sponsored by Michelob and played as a round robin from June 10-11 on Aviation Field at Forest Park in St. Louis, Missouri. The Pacific RFU repeated as champions.
Women's Club.
The 1978 Women's National Rugby Classic for club teams was co-sponsored by the Chicago Women's Rugby Football Club and Michelob beer. The teams invited needed to have won a major regional title and have a winning record. The games were played at Lion's Park in Mount Prospect, Illinois. The team from Portland, Maine won the championship with four shutouts: 3-0 over Denver Blues in the first round, 24-0 over Houston Boars in the second round, then 4-0 against Chicago, and finally 18-0 against Madison, Wisconsin. Chicago took third place with a 4-0 win over Florida State after three overtimes.
Champions: Portland(ME) Women's Rugby Club. Qualified as New England Champions.&lt;br&gt;
Record: 10-1-2&lt;br&gt;
Coaching Staff: Rocky Frenzilli, Ricky Scala(Aide), Peter Gillis(Aide)&lt;br&gt;
Roster: Sondra Spiers, Denise Dimitre, Pat Cribby, Kim Berry, Janet Muccino, Susan Adams, Brenda Costello, Mary Beth Staid, Reta Brown Flaherty, Brenda Swallow, Cheryl Ring, Ann Chippfield, Sue Malcolm, Marie Gagne, Amy Belliveau, Debbie Selleck (captain), Ann Chute, Mary Gouletand, Sue Lawler.
Monterey National Invitational.
The 1978 Monterey National Rugby Championship was the 20th edition of the tournament and was considered to be the de-facto national championship. This event took place at Pebble Beach, CA from March 25-26. The tournament MVP was Jeff Momsen (Old Blues), Miss Rugby winner was Nicole Parlette, Bill Armstrong of the Old Blues won the Running Drop Kick contest while Brian Lowe of UC Davis was runner-up. The Old Blues of Berkeley, CA went 5–0 to take first place.&lt;br&gt;
